import React, { Component } from 'react';
import Symbol from './Symbol';
import logo from ''

class Symbols extends Component {
    render() {
        const images = [
            "../resources/symbol_1.png",
            "../resources/symbol_2.png",
            "../resources/symbol_3.png",
            "../resources/symbol_4.png"
        ];

        return (
            <div>
                <Symbol src={images[0]} />
                <Symbol src={images[1]} />
                <Symbol src={images[2]} />
                <Symbol src={images[3]} />
                <Symbol src={images[4]} />
            </div>
        );
    }
}

export default Symbols;
